import React from "react";
import './css/navbar.css';
const NavBar =()=>{
return(
    <div className="Navbar">
   <nav>
    <ul>
    <li>Home</li>
    <li>Contact</li>
    <li>Service</li>
    <li>About</li>
    </ul>
   </nav>
    </div>
)
}

export default NavBar;
